// features of calendar: 
// 1. months and years should be choosable with scrollers
// 2. calendar should have weekday headers and week numbers on the left
// 3. each date click should select/unselect it(change color)
// 4. dates should have 3 colors for number (gray, black and red)
// 5. when selecting period - open right panel with plan-input and other info
// 6. 
// 7. select/unselect whole week with the click on week number
const DAYS_IN_WEEK = 7;

const initCalendar = (year, month) => {
    // generate or parse data for calendar
    // 1. check apis for generating this data
    // 2. found tutorial
    const months = [
        "January",
        "February",
        "March",
        "April",
        "May",
        "June",
        "July",
        "August",
        "September",
        "October",
        "November",
        "December"
    ];

    const weekHeads = ["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"];
    
    // if year=2021 and month=6(July), then new Date(2021, 6, 32) returns 1 (1st of August)
    // meaning that July has 32-1=31 dates
    const datesInMonth = 32 - new Date(year, month, 32).getUTCDate(); 
    
    let days = Array(datesInMonth).fill().map((v, i) => i+1)
    
    let firstDay = (new Date(year, month, 1)).getUTCDay(); // 0-6
    let lastDay = (new Date(year, month, datesInMonth)).getUTCDay(); 

    const prevMonthDays = Array(32 - new Date(year, month-1, 32).getUTCDate()).fill().map((v,i) => i+1);
    days = prevMonthDays
        .slice(prevMonthDays.length-firstDay)
        .concat(days);
    
    const nextMonthDays = Array(32 - new Date(year, month+1, 32).getUTCDate()).fill().map((v,i) => i+1);
    // 29, 30, 1, ..., 29, 30, 31, 1, 2, 3, 4
    days = days.concat(nextMonthDays.slice(0, DAYS_IN_WEEK-(lastDay+1))); 
    
    // build DOM
    let table = document.createElement("table");
    let head = document.createElement("tr");
    weekHeads.forEach((abbr) => {
        let cell = document.createElement("th");
        let cellText = document.createTextNode(abbr);
        cell.appendChild(cellText);
        head.appendChild(cell);
    });
    table.appendChild(head);

    let count = 1;
    for(let i=0; i<=days.length/DAYS_IN_WEEK; i++)
    {
        let row = document.createElement("tr");
        for(const day of days) {
            if(count % 7 === 0) break;
            
            let cell = document.createElement("td");
            let cellText = document.createTextNode(`${day}`);
            cell.appendChild(cellText);
            row.appendChild(cell);
            count++;
        }
        table.appendChild(row);
    }

    // insert table in DOM
    const widget = document.querySelector(".widget__calendar");
    widget.appendChild(table);
}

